import React from 'react'
import images from "../jsons/images.json"
import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import "../components/styles/imageGallery.css"

function ImageGallery() {
  return (
    <Carousel showThumbs={false} autoPlay infiniteLoop renderIndicator ={(clickHandler, isSelected, index, label) => (
        <p className={isSelected ? "selected" : "indicator"} onClick={clickHandler}>
          {`${index + 1}/${this.state.images.length}`}
        </p>
      )}>   
                <div>
                    <img src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/847.png" />
                </div>
                <div>
                    <img src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/850.png" />
                </div>
                <div>
                    <img src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/214.png" />
                </div>
    </Carousel>
  )
}

export default ImageGallery
